        private void CyclicRotation(int[] arreglo, int rotaciones)
        {
            int largo = arreglo.Length;
            int nuevoIndice = 0;
            int[] nuevoArreglo = new int[largo];

            if (rotaciones / largo != 0)
            {
                rotaciones = rotaciones % largo;
            }

            if (rotaciones < 0)
            {
                rotaciones = Math.Abs(Math.Abs(rotaciones) - 5);
            }
        
            for (int i = 0; i < largo; i++)
            {
                nuevoIndice = largo - rotaciones + i;

                if (nuevoIndice < largo)
                {
                    nuevoArreglo[i] = arreglo[nuevoIndice];
                }
                else
                {
                    nuevoArreglo[i] = arreglo[nuevoIndice - largo];
                }
            }

            string txt = "";
            for (int i = 0; i < largo; i++)
            {
                txt = txt + nuevoArreglo[i].ToString() + ",";
            }
            MessageBox.Show(txt);
        }

        private void BinaryGap(int num)
        {
            string txt = Convert.ToString(num, 2);
            int largo = txt.Length;
            int cont = 0;
            int resultado = 0;

            for (int i = 0; i < largo; i++)
            {
                if (txt[i] == '0')
                {
                    cont++;
                }
                else
                {
                    resultado = Math.Max(resultado, cont);
                    cont = 0;
                }
            }

            MessageBox.Show(num.ToString() + " - " + txt + " - " + resultado.ToString());
        }

