        private void Palindrome(int num)
        {
            int entero = Math.Abs(num);
            int residuo = 0;
            int numInvertido = 0;

            while (entero > 0)
            {
                residuo = entero % 10;
                entero = entero / 10;
                numInvertido = numInvertido * 10 + residuo;
            }

            if (num < 0) {
                MessageBox.Show("-" + num + " <> " + numInvertido + "-) The Numer is Not a Palindrome");
            }
            else if (num == numInvertido)
            {
                MessageBox.Show("-" + num + " == " + numInvertido + ") The Numer is a Palindrome");
            }
            else
            {
                MessageBox.Show("-" + num + " <> " + numInvertido + ") The Numer is Not a Palindrome");
            }
        }

        private void Contiguous(int[] arreglo)
        {
            txt = "";
            int suma;
            int largo = arreglo.Length;
            int[] resultado = new int[3];
            resultado[0] = 0;
            resultado[1] = 0;
            resultado[2] = arreglo[0];
            
            for (int x = 0; x < largo; x++)
            {
                suma = 0;

                for (int y = x; y < largo; y++)
                {
                    suma = suma + arreglo[y];

                    if (suma > resultado[2])
                    {
                        resultado[0] = x;
                        resultado[1] = y;
                        resultado[2] = suma;
                    }
                }
            }

            for (int i = resultado[0]; i <= resultado[1]; i++)
            {
                txt = txt + arreglo[i] + ", ";
            }

            MessageBox.Show(txt + " (" + resultado[2] + ")");
        }

        private void Contiguous2(int[] arreglo, int num)
        {
            txt = "";
            bool estado = false;
            int[] resultado = new int[2];
            resultado[0] = 0;
            resultado[1] = 0;
            int suma;

            for (int x = 0; x < arreglo.Length; x++)
            {
                if (x + 1 < arreglo.Length)
                {
                    for (int y = x + 1; y < arreglo.Length; y++)
                    {
                        suma = arreglo[x] + arreglo[y];

                        if (suma == num && !estado)
                        {
                            resultado[0] = x;
                            resultado[1] = y;
                            estado = true;
                            break;
                        }
                    }
                }
            }

            for (int i = resultado[0]; i <= resultado[1]; i++)
            {
                txt = txt + i + ", ";
            }

            if (estado)
            {
                MessageBox.Show(txt + "(" + num + ")");
            }
            else
            {
                MessageBox.Show("Not Found");
            } 
        }

        private void Prueba(int[] arreglo)
        {
            int largo = arreglo.Length;
            int suma = 0;
            int maximo = arreglo[0];

            for (int i = 0; i < largo; i++)
            {
                suma += arreglo[i];

                if (suma > maximo)
                {
                    maximo = suma;
                }

                if (suma < 0)
                {
                    suma = 0;
                }

                //maximo = Math.Max(suma, maximo);
                //suma = Math.Max(suma, 0);
            }

            MessageBox.Show(maximo.ToString());
        }
